using System;
using System.Collections.Generic;
using UnityEngine;
using UnityEngine.UI;
using Logger = Assets.Modules.SimpleLogging.Logger;

public class QueryImageHelper : MonoBehaviour {

	public Text infoText; // DEBUG
	public DeviceCam cam;


	public void TakePhoto() {
		StartCoroutine(CapturePhoto());
	}

	private string result;

	public String GetResult() {
		return result;
	}
	
	private IEnumerator<WaitForEndOfFrame> CapturePhoto() {
		yield return new WaitForEndOfFrame();

		WebCamTexture camera = cam.Cam;
		Texture2D photo = new Texture2D(camera.width, camera.height);
		photo.SetPixels32(camera.GetPixels32());
		photo.Apply();

		result = ToBase64DataUrl(photo);
		
		string excerpt = result.Substring(0, 40);
		infoText.text = excerpt;
		logger.Debug("ImageExcerpt: "+excerpt);
	}

	public static string DATA_URL_PREFIX = "data:";
	public static string IMAGE_PNG = "image/png;";
	public static string IMAGE_JPEG = "image/jpeg;";
	public static string DATA_URL_POST_IMAGE_SEQUENCE = "base64,";

	public const string TEST_DATAURL =
		"data:image/jpeg;base64,";
	
	public static string ToBase64DataUrl(Texture2D texture){
		byte[] png = texture.EncodeToPNG();
		string data = Convert.ToBase64String(png);
		return PNG_DATA_PREFIX+ data;
	}

	private static string PNG_DATA_PREFIX = DATA_URL_PREFIX + IMAGE_PNG + DATA_URL_POST_IMAGE_SEQUENCE;

	public static Texture2D FromBase64DataUrl(string data) {
		if (data.StartsWith(PNG_DATA_PREFIX)) {
			data = data.Substring(PNG_DATA_PREFIX.Length + 1);
		}

		byte[] png = Convert.FromBase64String(data);
		Texture2D texture = new Texture2D(100,100);
		texture.LoadRawTextureData(png);
		return texture;
	}
	
	private void OnEnable() {
		if (cam != null && cam.Cam != null) {
			cam.Cam.Play();
		}
	}


	private Logger logger;
	
}
